import React from 'react';
import './AboutUS.css'; // Import the CSS file for styling

function AboutUs() {
  return (
    <div className="about-us-container">
      <h1>About Us</h1>
      <p>Welcome to our interactive climbing beta app - Climbology! We are passionate about bringing the best climbing experience to your fingertips.</p>
      <p>Our team is dedicated to creating an innovative platform that combines the latest Generative AI technology with the thrill of climbing. With our app, climbers of all levels can discover and share routes, track their progress, and find beta.</p>
      <p>Stay tuned for more exciting features and updates as we continue to develop grow!</p>
    </div>
  );
}

export default AboutUs;
